import axios from 'axios'

class Main extends Component {
    state = { 
        users: [],
        sample:[
            {
                name:'Tonoy',
                age:24,
                home:'kg',
                address: {
                    street:"Uttara Road",
                    city:"Nagua"
                }
            },
            {
                name:'john',
                age:20,
                home:'kg'
            }
        ]
     }

     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response)
              this.setState({
                 users: response.data
             })
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 

        // let { users } = this.state

